class CityModel {
  final String name;
  final String info;
  final String moreInfoUrl;
  final String mapUrl;
  final String image;

  CityModel({
    required this.name,
    required this.info,
    required this.moreInfoUrl,
    required this.mapUrl,
    required this.image,
  });

  factory CityModel.fromJson(Map<String, dynamic> json) {
    return CityModel(
      name: json['name'],
      info: json['info'],
      moreInfoUrl: json['more_info_url'],
      mapUrl: json['map_url'],
      image: json['image'],
    );
  }
}

